        private static readonly ConcurrentDictionary<string, AvatarValue> _values =
            new ConcurrentDictionary<string, AvatarValue>(_knownValues);

        private AvatarValue(string value)
        {
            if (value == null) throw new ArgumentNullException(nameof(value));
            Value = value;
        }

        public string Value { get; }

        public static AvatarValue Of(string value)
        {
            return _values.GetOrAdd(value, _ => new AvatarValue(value));
        }

        public static implicit operator AvatarValue(string value) => Of(value);
        public static implicit operator string(AvatarValue avatarvalue) => avatarvalue.Value;

        public static AvatarValue[] Values()
        {
            return _values.Values.ToArray();
        }

        public override string ToString() => Value.ToString();

        public bool IsKnown()
        {
            return _knownValues.ContainsKey(Value);
        }

        public override bool Equals(object? obj) => Equals(obj as AvatarValue);

        public bool Equals(AvatarValue? other)
        {
            if (ReferenceEquals(this, other)) return true;
            if (other is null) return false;
            return string.Equals(Value, other.Value);
        }

        public override int GetHashCode() => Value.GetHashCode();
    }

